using System;using System.Linq;using System.Text;namespace EntidadesLayout.Ent {	[Serializable]	public class IAF	{		private Guid iAFKey;		private string name;		private string description;		private int? orden;		public IAF(){}		public Guid IAFKey		{			get { return iAFKey; }			set { iAFKey = value; }		}		public string Name		{			get { return name; }			set { name = value; }		}		public string Description		{			get { return description; }			set { description = value; }		}		public int? Orden		{			get { return orden; }			set { orden = value; }		}	}}

